import { Route } from 'react-router-dom'
import Home from "./components/Home/Home";
import Landing from './components/Landing/Landing'

function App() {
  return (
    <div className="App">
        <Route exact path="/" component={Landing} />
        <Route exact path="/home" component={Home} />

    </div>
  );
}

export default App;
